def generateCenterline(roadBlocks):
    inc = 0.5
    cl = []
    for i in range(len(roadBlocks)-1):
        c = roadBlocks[i]
        n = roadBlocks[i+1]
        if c[0] == n[0]:
            if c[1] > n[1]:
                y = c[1]
                while y > n[1]:
                    cl.append(( c[0], round(y,1) ))
                    y -= inc
            else:
                y = c[1]
                while y < n[1]:
                    cl.append(( c[0], round(y,1) ))
                    y += inc
        else:
            if c[0] > n[0]:
                x = c[0]
                while x > n[0]:
                    cl.append(( round(x,1), c[1] ))
                    x -= inc
            else:
                x = c[0]
                while x < n[0]:
                    cl.append(( round(x,1), c[1] ))
                    x += inc
    return cl
